Florida residents are lining up for food as the pandemic leaves many hungry. It's a scene being replayed across the US.

"This is an indication of the pain and suffering that's being felt across the nation," one county official says.

@RosaFlores reports. https://t.co/D52pvRUDMr https://t.co/v9tGourLyi

